// 再生機能
function playSelectedFile() {
    const formValues = [
        document.querySelector('input[name="range"]:checked')?.value,
        document.querySelector('input[name="jump"]:checked')?.value,
        document.querySelector('input[name="timing"]:checked')?.value,
        document.querySelector('input[name="simulCount"]:checked')?.value,
        document.querySelector('input[name="chord"]:checked')?.value,
        document.querySelector('input[name="rhythm"]:checked')?.value,
        document.querySelector('input[name="accent"]:checked')?.value,
        document.querySelector('input[name="hand"]:checked')?.value,
        document.querySelector('input[name="tone"]:checked')?.value
    ];

    let selectedFile = audioFileMap;
    for (const value of formValues) {
        if (selectedFile && selectedFile[value]) {
            selectedFile = selectedFile[value];
        } else {
            selectedFile = null;
            break;
        }
    }

    let BselectedFile = BaudioFileMap;
    const rhythmValue = document.querySelector('input[name="rhythm"]:checked')?.value;
    if (BselectedFile && rhythmValue && BselectedFile[rhythmValue]) {
        BselectedFile = BselectedFile[rhythmValue];
    } else {
        BselectedFile = null;
    }

    if (typeof selectedFile === 'string' && typeof BselectedFile === 'string') {
        const audioPlayer1 = document.getElementById('audioPlayer1');
        const audioPlayer2 = document.getElementById('audioPlayer2');
        audioPlayer1.src = selectedFile;
        audioPlayer2.src = BselectedFile;
        audioPlayer1.play();
        audioPlayer2.play();
    } else {
        alert("該当するファイルが見つかりません。");
    }
}

function playstop(){
    const audioPlayer1 = document.getElementById('audioPlayer1');
    const audioPlayer2 = document.getElementById('audioPlayer2');
    audioPlayer1.pause();
    audioPlayer2.pause();
}

function toggleCollapse(element) {
    const content = element.nextElementSibling;
    if (content.style.display === "none" || content.style.display === "") {
        content.style.display = "block";
        element.textContent = element.textContent.replace("▼", "▲");
    } else {
        content.style.display = "none";
        element.textContent = element.textContent.replace("▲", "▼");
    }
}
